import React from 'react';

import {
  ContentBlock,
  ContentPage,
  ContentItem,
  ContentItemHeader,
  ContentItemBody
} from './styles';

const Content = ({ content }) => {
  return (
    <ContentBlock>
      <ContentItemHeader />
      <ContentItemBody>{content}</ContentItemBody>
    </ContentBlock>
  );
};

export default Content;
